    false,nt"url": null,nt"notes": "This narrative report for Bombay Hook NWR
    outlines Refuge accomplishments from May through August of 1960. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, raptors, fish, and reptiles-
    is also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, and collections and receipts. Resource management is outlined;
    topics include haying and commercial fishing. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, and violations.
    N-R forms and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
